import React, { Component } from 'react'
import axios from 'axios';

export class Disposition extends Component {

    render() {
        console.log(this.props)
        const {action} = this.props.action
        let chauffeur;
        if(this.props.chauffeur.disponible == ""){
            chauffeur = (
                <>
                    <td>{this.props.chauffeur.prenom} </td>
                    <td>{this.props.chauffeur.categorie_permis} </td>
                    <td>{this.props.chauffeur.adresse} </td>
                    <td>{this.props.chauffeur.province} </td>
                    <td>{this.props.chauffeur.disponible} </td>
                    <td>
                        <a class="btn btn-danger" onClick={() => action.deleteChauffeur(chauffeur)} role="button">
                            delete
                        </a>
                    </td>
                </>
            )
        }
        return (
            <>
                {chauffeur}
            </>

        )
    }
}

export default Disposition
